import React from 'react';
import { MdCall } from "react-icons/md";
import { BsFillChatDotsFill } from "react-icons/bs";
import { HiChatBubbleBottomCenter } from "react-icons/hi";
import Facebook from "../../assets/facebook-square-brands.svg";
import LinkedId from "../../assets/linkedin-brands.svg";
import Twitter from "../../assets/twitter-square-brands.svg";
import Instagram from "../../assets/instagram-square-brands.svg";
import styled from "styled-components";

const ContactSection = styled.section`
  width: 100vw;
  padding: calc(2.5rem + 2.5vw) 0;
  background-color: #0a0b10;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

const Title = styled.h1`
  color: var(--white);
  display: inline-block;
  font-size: 2rem;
  margin-bottom: 3rem;
  position: relative;
  &::before {
    content: "";
    height: 1px;
    width: 50%;
    position: absolute;
    left: 50%;
    bottom: 0;
    transform: translate(-50%, 0.5rem);
    border-bottom: 2px solid var(--pink);
  }
`;

const Icons = styled.div`
  display: flex;
  margin-bottom: 3rem;
  a {
    &:hover {
      img {
        filter: invert(20%) sepia(100%) saturate(500%) hue-rotate(580deg) brightness(100%) contrast(97%);
      }
    }
    &:not(:last-child) {
      margin-right: 2rem;
    }
    img {
      width: 3rem;
      height: 3rem;
    }
  }
`;

const Contact = () => {
  return (
    <ContactSection id="contact">
      <Title>Get in touch</Title>
      <Icons>
        <a href="https://www.facebook.com/">
          <img src={Facebook} alt="Facebook" />
        </a>
        <a href="https://www.linkedin.com//">
          <img src={LinkedId} alt="LinkedId" />
        </a>
        <a href="https://twitter.com/">
          <img src={Twitter} alt="Twitter" />
        </a>
        <a href="https://www.instagram.com/">
          <img src={Instagram} alt="Instagram" />
        </a>
      </Icons>
      <div className="flexColStart contactModes">
        <div className="flexStart row">
          <div className="flexColCenter mode">
            <div className="flexStart">
              <div className="flexCenter icon">
                <MdCall size={25} />
              </div>
              <div className="flexColStart detail">
                <span className="primaryText">Call</span>
                <span className="secondaryText">021 123 145 14</span>
              </div>
            </div>
            <div className="flexCenter button">Call now</div>
          </div>

          <div className="flexColCenter mode">
            <div className="flexStart">
              <div className="flexCenter icon">
                <BsFillChatDotsFill size={25} />
              </div>
              <div className="flexColStart detail">
                <span className="primaryText">email</span>
                <span className="secondaryText">021 123 145 14</span>
              </div>
            </div>
            <div className="flexCenter button">send now</div>
          </div>
        </div>

        <div className="flexStart row">
          <div className="flexColCenter mode">
            <div className="flexStart">
              <div className="flexCenter icon">
                <BsFillChatDotsFill size={25} />
              </div>
              <div className="flexColStart detail">
                <span className="primaryText">what's up</span>
                <span className="secondaryText">021 123 145 14</span>
              </div>
            </div>
            <div className="flexCenter button"> Call now</div>
          </div>

          <div className="flexColCenter mode">
            <div className="flexStart">
              <div className="flexCenter icon">
                <HiChatBubbleBottomCenter size={25} />
              </div>
              <div className="flexColStart detail">
                <span className="primaryText">Message</span>
                <span className="secondaryText">021 123 145 14</span>
              </div>
            </div>
            <div className="flexCenter button">Message now</div>
          </div>
        </div>
      </div>
    </ContactSection>
  );
};

export default Contact;
